import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { ProductListComponent } from './components/product-list/product-list.component';
import { ProductDetailComponent } from './components/product-detail/product-detail.component';
import { PdoductItemComponent } from './components/product-item/pdoduct-item/pdoduct-item.component';
import { HompageComponent } from './pages/hompage/hompage.component';
import { ProductItemComponent } from './components/product-item/product-item.component';
import { RouingComponent } from './rouing/rouing.component';
import { DashboardComponent } from './pages/dashboard/dashboard.component';

@NgModule({
  declarations: [
    AppComponent,
    ProductListComponent,
    ProductDetailComponent,
    PdoductItemComponent,
    HompageComponent,
    ProductItemComponent,
    RouingComponent,
    DashboardComponent,
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
